CREATE DEFINER=`root`@`localhost` PROCEDURE `del_Traslado_Vacio`(codigoLocalDel VARCHAR(10))
BEGIN 
	SET @cantidadVacios = 0;
	SET @codigoTraslado = "";
	SELECT COUNT(*) INTO @cantidadVacios FROM traslado 
	WHERE origenTraslado LIKE codigoLocalDel
	AND destinoTraslado IS NULL and valorTotal IS NULL;
	WHILE @cantidadVacios > 0 
	DO
		SELECT MAX(codigoTraslado) INTO @codigoTraslado FROM traslado 
		WHERE origenTraslado LIKE codigoLocalDel
		AND destinoTraslado IS NULL and valorTotal IS NULL;
        
		DELETE FROM traslado WHERE codigoTraslado = @codigoTraslado;
		DELETE FROM trasladoDetalle WHERE codigoTraslado = @codigoTraslado;
        
		SET @cantidadVacios = @cantidadVacios - 1;
	END WHILE;
END;;

