DROP PROCEDURE IF EXISTS `get_Codigo_Generado`;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `get_Codigo_Generado`(ultimoCodigo VARCHAR(15), tipoCodigo VARCHAR(15), longitudCodigo INT(2), out codigoGenerado VARCHAR(15))
BEGIN
    DECLARE ceros INT;
    SET @ultimoCodigoVerificado="";
    IF ultimoCodigo IS NOT null
		THEN SET @ultimoCodigoVerificado = ultimoCodigo;
    END IF;
	SET @codCliGenerador = CONVERT(SUBSTRING(@ultimoCodigoVerificado,char_length(tipoCodigo) + 2), UNSIGNED INTEGER) + 1;
    SET @cerosCodigo = (longitudCodigo - char_length(tipoCodigo)) - char_length(@codCliGenerador);
    SET @generador = CONCAT(tipoCodigo,"-");
    SET ceros = @cerosCodigo - 1;
	WHILE ceros > 0 
    DO
		SET @generador = CONCAT(@generador,'0');
		SET ceros = ceros - 1;
    END WHILE;
    SET @generador = CONCAT( @generador , @codCliGenerador );
    SET codigoGenerado = @generador;
END;;

