DROP PROCEDURE IF EXISTS `get_Producto`;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `get_Producto`(codigoProductoVAR VARCHAR(10), codigoLocalVAR VARCHAR(10))
BEGIN
    SELECT p.* , tp.nombreTipoProducto , pr.descripcionPresentacion, l.nombreLocal, m.urlMedia, pre.valorPrecio
    FROM producto p, tipoProducto tp, presentacion pr, local l, media m , precio pre, tipoPrecio tpre
    WHERE p.codigoTipoProducto = tp.codigoTipoProducto and p.codigoPresentacion = pr.codigoPresentacion 
    and p.codigoLocal = l.codigoLocal and p.codigoMedia = m.codigoMedia and pre.codigoProducto = p.codigoProducto 
