DROP PROCEDURE IF EXISTS `get_Traslado_Reporte`;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `get_Traslado_Reporte`(fechaInicioReporte VARCHAR(20),fechaFinReporte VARCHAR(20))
BEGIN
	SELECT (select count(*) from  trasladoDetalle td where td.codigoTraslado = ts.codigoTraslado) as detalles,
    ts.*, lo.nombreLocal as nombreLocalOrigen , ld.nombreLocal as nombreLocalDestino, 
    tbUR.nombreTrabajador as nombreTrabajadorRegistro, tbUC.nombreTrabajador as nombreTrabajadorConfirmacion
    FROM traslado ts, local lo, local ld ,usuario uR, usuario uC, trabajador tbUR, trabajador tbUC  
    WHERE lo.codigoLocal = ts.origenTraslado and ld.codigoLocal = ts.destinoTraslado and ts.codigoUsuario = uR.codigoUsuario 
		and ts.codigoUsuarioConfirmacion =  uC.codigoUsuario
        and uR.codigoTrabajador = tbUR.codigoTrabajador and uC.codigoTrabajador = tbUC.codigoTrabajador and
        ts.fechaRegistro >= fechaInicioReporte AND ts.fechaRegistro <= fechaFinReporte;
END;;

DROP PROCEDURE IF EXISTS `get_Traslado_Reporte_Confirmado`;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `get_Traslado_Reporte_Confirmado`(fechaInicioReporte VARCHAR(20),fechaFinReporte VARCHAR(20))
BEGIN
	SELECT (select count(*) from  trasladoDetalle td where td.codigoTraslado = ts.codigoTraslado) as detalles,
    ts.*, lo.nombreLocal as nombreLocalOrigen , ld.nombreLocal as nombreLocalDestino, 
    tbUR.nombreTrabajador as nombreTrabajadorRegistro, tbUC.nombreTrabajador as nombreTrabajadorConfirmacion
    FROM traslado ts, local lo, local ld ,usuario uR, usuario uC, trabajador tbUR, trabajador tbUC  
    WHERE lo.codigoLocal = ts.origenTraslado and ld.codigoLocal = ts.destinoTraslado and ts.codigoUsuario = uR.codigoUsuario 
		and ts.codigoUsuarioConfirmacion =  uC.codigoUsuario and ts.confirmacion is true
        and uR.codigoTrabajador = tbUR.codigoTrabajador and uC.codigoTrabajador = tbUC.codigoTrabajador
        and ts.fechaRegistro >= fechaInicioReporte AND ts.fechaRegistro <= fechaFinReporte;
END;;

