BEGIN
    SET @ultimoIngreso = "";
    SELECT MAX(fechaIngreso) INTO @ultimoIngreso from inicioSesion
    WHERE codigoUsuario LIKE codigoUsuarioVAR;

    SELECT t.*, mt.urlMedia as urlMediaTrabajador , mt.altMedia as altMediaTrabajador, u.nombreUsuario , u.estadoUsuario ,
			mu.urlMedia as urlMediaUsuario , mu.altMedia as altMediaUsuario, 
            u.conexionUsuario , i.estadoSesion, i.fechaIngreso, i.fechaSalida
            
    FROM usuario u , trabajador t, media mu, media mt, inicioSesion i
    
    WHERE u.codigoUsuario LIKE codigoUsuarioVAR and u.codigoTrabajador LIKE t.codigoTrabajador and
		u.codigoMedia LIKE mu.codigoMedia and t.codigoMedia LIKE mt.codigoMedia
        and i.fechaIngreso = @ultimoIngreso and i.codigoUsuario = u.codigoUsuario;
END;;

