DROP PROCEDURE IF EXISTS `put_Sesion_Cerrar`;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `put_Sesion_Cerrar`(    
    codigoUsuarioPUT VARCHAR(10))
BEGIN 
	SET @ultimaConexion = "";
    SELECT MAX(codigoSesion) INTO @ultimaConexion FROM inicioSesion WHERE codigoUsuario LIKE codigoUsuarioPUT AND estadoSesion IS TRUE;
	UPDATE inicioSesion
    SET
        estadoSesion = FALSE,
        fechaSalida = NOW()
	WHERE codigoSesion LIKE @ultimaConexion;
END;;

